import imgS01 from "./assets/images/dummy/section-description-1.png";
import imgS02 from "./assets/images/dummy/section-description-2.png";
import HeroBanner from "./HeroBanner";
import OurServices from "./OurServices";
import Blog from "./Blog";
import Testimonials from "./Testimonials";
import SectionDescription from "./SectionDescription";

function App() {
  const dataSection1 = {
    image: imgS01,
    title:
      "Trafalgar provides progressive, and affordable healthcare, accessible on mobile and online for everyone. To us, its not just work. We take pride in the solutions we deliver",
    desc: "Trafalgar provides progressive, and affordable healthcare, accessible on mobile and online for everyone. To us, its not just work. We take pride in the solutions we deliver",
    to: "/service",
    btnText: "Learn More",
  };
  const dataSection2 = {
    image: imgS02,
    title: "Download our mobile apps",
    desc: "Our dedicated patient engagement app and web portal allow you to access information instantaneously (no tedeous form, long calls, or administrative hassle) and securely",
    to: "/providers",
    btnText: "Download",
  };
  return (
    <>
      <div className="main-site">
        <HeroBanner />
        <OurServices />
        <SectionDescription
          data={dataSection1.image}
          title={dataSection1.title}
          description={dataSection1.desc}
          to={dataSection1.to}
          textButton={dataSection1.btnText}
        />
        <SectionDescription
          data={dataSection2.image}
          title={dataSection2.title}
          description={dataSection2.desc}
          to={dataSection2.to}
          textButton={dataSection2.btnText}
        />
        <Testimonials />
        <Blog />
      </div>
    </>
  );
}

export default App;
